import React from 'react';
import Part from './Part';

const Content = ({ parts }) => {
  const partsList = parts.map(part => {
    const { title, exercises } = part;
    return <Part title={title} exercise={exercises} />
  })

  return (
    <div>
      <Part title={parts[0].title} exercise={parts[0].exercises} />
      <Part title={parts[1].title} exercise={parts[1].exercises} />
      <Part title={parts[2].title} exercise={parts[2].exercises} />     
    </div>
  )
}

export default Content;
